import React from "react";
import team1 from "../assets/images/team1.jpeg"
import team2 from "../assets/images/team2.jpeg"
import team3 from "../assets/images/team1.jpeg"
import team4 from "../assets/images/team1.jpeg"
import team5 from "../assets/images/team1.jpeg"
import team6 from "../assets/images/team6.jpeg"
import team7 from "../assets/images/team7.jpeg"
import team8 from "../assets/images/team8.jpeg"
import team9 from "../assets/images/team9.jpeg"
import team10 from "../assets/images/team10.jpeg"


const teamMembers = [
  {
    name: "Member 1",
    role: "Founder & Environmental Activist",
    image: team1,
  },
  {
    name: "Member 2",
    role: "Project Coordinator",
    image: "/images/team2.jpg",
  },
  {
    name: "Member 3",
    role: "Field Officer",
    image: "/images/team3.jpg",
  },
  {
    name: "Member 4",
    role: "Communication Head",
    image: "/images/team4.jpg",
  },
  {
    name: "Member 5",
    role: "Tree Conservationist",
    image: "/images/team5.jpg",
  },
  {
    name: "Member 6",
    role: "Volunteer Manager",
    image: "/images/team6.jpg",
  },
  {
    name: "Member 7",
    role: "Operations Lead",
    image: "/images/team7.jpg",
  },
  {
    name: "Member 8",
    role: "CSR Coordinator",
    image: "/images/team8.jpg",
  },
  {
    name: "Member 9",
    role: "Data Analyst",
    image: "/images/team9.jpg",
  },
  {
    name: "Member 10",
    role: "Field Volunteer",
    image: "/images/team10.jpg",
  },
];

const OurTeam = () => {
  return (
    <div className="text-gray-800">
      {/* Header */}
      <section className="bg-green-700 text-white text-center py-16">
        <h1 className="text-4xl font-bold mb-2">Meet Our Team</h1>
        <p className="text-lg">The passionate people behind Sahyadri Devrai</p>
      </section>

      {/* Team Grid */}
      <section className="py-16 px-6 md:px-20 bg-white">
        <div className="grid sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-5 gap-10">
          {teamMembers.map((member, index) => (
            <div
              key={index}
              className="bg-gray-50 p-6 rounded-lg shadow hover:shadow-lg transition text-center"
            >
              <img
                src={member.image}
                alt={member.name}
                className="w-32 h-32 mx-auto rounded-full object-cover mb-4 border-4 border-green-200"
              />
              <h4 className="text-xl font-semibold">{member.name}</h4>
              <p className="text-sm text-gray-600">{member.role}</p>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};

export default OurTeam;
